angular.module('menu').run(['$templateCache', function($templateCache) {
  'use strict';

  $templateCache.put('src/menu/menu.html',
    "<p>This is an awesome menu!</p>\n" +
    "\n" +
    "<p>Menu items: </p>\n" +
    "\n" +
    "<div ng-controller=\"menuController\">\n" +
    "    <div ng-repeat=\"menuItem in menuItems\">\n" +
    "        {{ menuItem.name }}\n" +
    "    </div>\n" +
    "</div>\n"
  );

}]);
